import React from "react";
import "../App.css";
function navigation(props){
    return (
            <nav className="navbar">
                <ul className="nav">
                    <li>{props.value}</li>
                    <li>Band</li>
                    <li>Tour</li>
                    <li>Contact</li>
                </ul>
            </nav>
    );
}
export default navigation;
